import React from 'react'

const Index = () => {   // Componente: retorna estrutura em JSX que descreve parte da interface
    return (
        <div>
            <h1>Home</h1>
            <a href='/api/login' className='py-1 px-2 rounded bg-pink-800 font-bold shadow-xl hover:shadow text-white w-1/4 block mx-auto text-center'>Start here</a>
        </div>
    )
}

export default Index
